import React, { useState } from 'react';

import IdintetyList from './IdintetyList';
import classes from './MyProfile.module.css';

const MyProfile = () => {
  const [idintety, setIdintety] = useState();
  const url =
    'https://pro-crew-52de7-default-rtdb.firebaseio.com/identety.json';

  const getDataHandeler = async () => {
    try {
      const response = await fetch(url);
      if (!response.ok) {
        throw new Error('somthing Went Wrong');
      }
      const data = await response.json();

      const dataArrived = [];

      for (const key in data) {
        dataArrived.push({
          Name: data[key].Name,
          Age: data[key].Age,
          Hobby: data[key].Hobby,
        });
      }

      setIdintety(dataArrived);
    } catch (error) {
      console.log(error);
    }
  };
  return (
    <section className={classes.box}>
      <div className={classes.actions}>
        <button onClick={getDataHandeler}>Get Your Data</button>
      </div>
      <IdintetyList idintetyInfo={idintety} />
    </section>
  );
};

export default MyProfile;
